INSERT INTO CURSO(ID, NOME, DESCRICAO) VALUES
('baf92805-10e8-5d98-ac55-ea863d2fcce2', 'Claims Manager', 'Iwaala buiveoje dounji koddun emuug epawir nonro ca duvunbot zubov ivbej coje zu edowa obfap zubin afsob lebe. Uzi bow lujzi viji ri ticajka ha azuhade ji ro vegaja mak ilju uzwi rugik.'), ('e756d8f6-2b23-5d4c-8f1a-15965b3d79d0', 'Political Scientist', 'Pin bakocla siittas betap luzni ivaug isetef ci bidsooka biw leaga adusoj. Ubo heritohah owho vice jabgikfe siajeeke buvhof segbu liwe ul gagnaf fe ijiki udo nuv nuzi.'), ('3da00a93-751e-5486-8e42-494fc2f34442', 'Strategic Alliance Director', 'Pinehgam ibulutmup ila nepufac hoc neh repebseg iwoneni liwupelo puotu livceg wuih. Ko temmurzas cezev dedtuno kun ta rulu injeji vadjeg biohdu haj bek alozi du.'), ('1ef29ef2-c440-5075-b0d1-8205e268bc7d', 'Petroleum Engineer', 'Jera ewoude te kus ibisuvjog mar initegbif kuapo mafjupaz ewjad ijme havov rezoko gussomnid zo hafco vasep josnegar. Viprapih rozsoiz ine tucrettok ho wul ne hikekni huci pi maduwaf ibo.');
