('ca6fbe4b-62cf-52bb-a506-c183c86efbf7', 'Fraud Unified', 'Wasnepa udwamma uno mu age wa borog bebkunuw cufrihe leloru funoc kiwowi ziabo hu pigip lacewjut. Uvu naejtu caj figarmu eb sidon rupekeban cecvimup wabacpo gokiba lola sa azramoj isawku tuhbavo retider.'), ('22ffaece-8f70-5f0e-8390-ba479c5b0406', 'Law Fisher', 'Ziw ge cem ropu novga gah lu egjilzum ludrer ohuofo mi oznosa tawwa vecjah bewa tohu fidowerin. Barci ibupin obse kidje sapviv camu gatjizogu votomaj ce jokko rulavizec mokdaeda guika godeghem zuzej rincuih agmokdo.'), ('1fc63141-c180-58b8-b853-05cb19f3522a', 'Franchise Simon', 'Zifbap dab lulda gal kid tug dijobofok cemjetba monne zun eja duscinsoz jo joodu. Wefuk rop lajipwih wowa zuftu mah opooc ejacealo iw ewsolhow tit kavuupu.'), ('8d30f44b-f7b3-5288-a8c1-bf2b810ecdb9', 'Food Constellation', 'Dihi ha hegejdic jampalil gasatwu mamsiola tug neelo elu gekzesumo cokilpim poci zemrohtuk ime inukonve vawud le uglugeb. Azu mi ud riaw jihuluba becbol od adicin jemnop duzagfo se aj polan enivaju.'), ('5dd56b81-2c0d-544b-8f4e-9496a8f5337b', 'Physicist Allergan,', 'Nenhi backi imigu zite odudu fudcera ukoropo capon davahtek ticavo picuj cabcu powu piri. Jori pudwapa bi elu tuted baisufa takvewkem buweg gak laveper laji os hire tortofci og.'), ('8a82dc8d-e36a-568e-b7d7-a9aeac853045', 'Rehabilitation Corning', 'Dewtisaci foh bol enewolur cub apa cectitin ebo ubu losuzre ce figugce emufa sab fokufep wez ke. Duwig izafilho acenisoh ficelor samialu kepzum eccu zobupoc idjascuc umamalir pozukbol joaje nuween husur upluvvu amufu pobdujtuv nove.'), ('493ee958-8879-5561-8204-fcd4e2cdb74b', 'Career Starwood', 'Satdokbap zunkeabu ladcopi es iho up ac zegpuwuh kasuke lagpov itowarej tes welora nomti. Ewcoh tulpapu iki me bakit ruwtic def zuf telnu edege wa vem nawu tod kigdevdom ful.'), ('73a2d948-29be-574b-a0c8-4edd37b6201e', 'Sales Great', 'Dov erkiz ahlorcul pipuw to so sa tol nugtapeb fih rovum laispe. Epaga rascedura adbuv walavuj vihvouva tuk fuvohpe iseehvog fudcabbu kuecame sewisok odoebmo gotadehi hig dosohiwe.');
INSERT INTO TURMA(ID, NOME, DESCRICAO, DISCIPLINA_FK) VALUES
('a8172343-463a-5d66-9ecb-27b771d4bd13', '465 - Food Constellation', 'Mosohemi kog beipo hir goh her welu zuw ujoca nil buvucmug rukze. Fokva burcu homputed zib fuvse hogurvip lofhuv juhkolba wobifli gawedne sintew vujeko da wuk cuwuj.', '8d30f44b-f7b3-5288-a8c1-bf2b810ecdb9'), ('57edd535-2f77-5549-b874-77b95576b60d', '294 - Rehabilitation Corning', 'Relcah ebnosfi punmas zabik bi kedu umacju na obiwoseg egomuc jazoze pu. Lu nefec wijhurew otjugwom saf me ra kurra dudated gu wavaz ek kerrih agikije wola ti.', '8a82dc8d-e36a-568e-b7d7-a9aeac853045'), ('105dbb56-5e7f-543f-b2b3-dfe8f1d51c3c', '700 - Fraud Unified', 'Gesimebo tuj puuvajo ale omhuwu siwugga ewepal lighavcaz tukub lep isogokeb etohofam zujuto kavagvig eravehuh. Pivopuzu gun agcazkav li humosuf cozim uwuzer oluna ajveludu ba di riwi bu pihizula hu pagusop.', 'ca6fbe4b-62cf-52bb-a506-c183c86efbf7'), ('debd893f-6258-5c41-b5fb-695989b70da0', '686 - Physicist Allergan,', 'Za lawkeme opavamam noaco ureluvu ol hi muggumi geh mukovje bamfu bana obici uba muswot fes ulaololur ufo. Fu cozridin vo huzun bottesam poifagi mivapa amzuzli kiz otamit suuhbi lemze ih.', '5dd56b81-2c0d-544b-8f4e-9496a8f5337b'), ('0e6602b9-25d5-5368-806f-37db67a647d5', '488 - Physicist Allergan,', 'Urteflet ufa om cav demoboga azajaok cu fi nihcakus wawej suzer enpu eglef kebicap naknanis pa. To tozazafip vuijagug zocmo rokro dub cofos laigo bifga jisruet jodni jahemasi fejon gupefiuwa nade.', '5dd56b81-2c0d-544b-8f4e-9496a8f5337b'), ('71e7d152-d8b7-5d0f-870a-84e1300a1a0b', '378 - Physicist Allergan,', 'Te ki josugjep ivavinur sij onpegkek bo el aj elora bag fuffowe ke nafebo rifanagi ado. Vorluv letuvokep eki cota zaizle roeva jo soafga sedofga higwagec kasudbof jefbovap puv cicwelo dabtu.', '5dd56b81-2c0d-544b-8f4e-9496a8f5337b'), ('dd1451cd-3a7f-5078-9991-bb71e0ea6bf7', '245 - Physicist Allergan,', 'Eb pabegsu lecas su ec ub iwehuj sevza jimot asuahmik fiteh zehubodu fu abwa. Har ivwiagu li redvo ahufu ki gic talpu wewucej nuzhevdi ru nutuhjek zij urot gewu.', '5dd56b81-2c0d-544b-8f4e-9496a8f5337b'), ('298ace85-de58-5a5c-bf11-13ea40835915', '193 - Career Starwood', 'Wekwok avzuwab voc ebzeh eceuddul cowru kahnin jehom hevgu onac sakvahul ajcoef bisleg loncughi kirastoc zesod bonuv. Volkirlin aga kobahjo piredmed poapimo moh azotet putbom kuvihjut bigu sul gocperfo johud mid.', '493ee958-8879-5561-8204-fcd4e2cdb74b'), ('4b1439f7-0016-5e8f-8a13-afd8ec1f00f4', '187 - Physicist Allergan,', 'Epidu cufe meki vetilav ro zo gulfig imzugda uwe netebhuc rub lepla ekevitud uhwisi ve. Note miswanat kafbeov mamnofvo neanueha fonoonu raejde jul vog ho uh wer ti sup ofton ho.', '5dd56b81-2c0d-544b-8f4e-9496a8f5337b'), ('d150ed09-2cdb-595c-bdbd-9fb7b0c56258', '794 - Food Constellation', 'Miw te kicfe nenuwhe elwumhat rigeg hejuv nu vihru otnig copa ige asezaoli lol vewile. Rupihiw neltikta baazo bajju agfofif maumuri neri ruhnec jopgi liemabav medemomo tohadjez.', '8d30f44b-f7b3-5288-a8c1-bf2b810ecdb9'), ('01ae4401-e656-5b44-abdb-2cba091eb14a', '631 - Franchise Simon', 'Du kecozot ci radwaj gidnegu hem wi ejakoje cikenpab sazina helfa fes ewba toovoudu gid. Deah ipluju eri evouma epouc ucahip fiweile civugud afmathe cohadem kidite orpojfi deiwenul si joka.', '1fc63141-c180-58b8-b853-05cb19f3522a'), ('84312aac-51a3-59d4-93e2-f8e4cc06767e', '378 - Rehabilitation Corning', 'Li evurib ese tatvor emave afuficag fepiluz udasekfi gosip dusli cewwu hekiru go mattes famofem to te otgut. Enowi ovuhu nehezitu irune ju zepfapka wirotog hila butdiphe tiwrij gul bahkuid godlobrog ajojen lilotu aviunnoc.', '8a82dc8d-e36a-568e-b7d7-a9aeac853045'), ('aeb813a0-20ff-5e03-a153-30142c567477', '747 - Rehabilitation Corning', 'Dabsowe cejuzvi deami mugmetder uproap jijef kuswulvo ti gufelto pez torithe wuto kekzi vaczu balat mogiva. Utjet dagowvoc hoc zopujesu asofauha ap umhur jaij ve hopuhur libwawus gubfitot nurfobo.', '8a82dc8d-e36a-568e-b7d7-a9aeac853045'), ('78d9283e-0961-5d2a-b5f8-0d8b76dabe63', '750 - Sales Great', 'Nuhsu po temjoc jip wunewav pu amseb gidap wiwsoba jamzom jenteb wago ifha kaga jit zagipfi fi. Vug bu li uv upisomwab viv uzecuvi mepaz fapobjif af wilvin ifnok.', '73a2d948-29be-574b-a0c8-4edd37b6201e'), ('e0e78598-88ce-501a-b8d2-1da27abeae3b', '428 - Rehabilitation Corning', 'Kud owpo eh ve huezi juh labobeb haehazu osadel wu zus sub dohazgil nekecene uni cow sa. Ekuvar vodfu uz gaari ej juzib ejejel dujro donuhga cas pircavnac sifejec.', '8a82dc8d-e36a-568e-b7d7-a9aeac853045'), ('dd9e5d65-488e-5091-8f1f-73cb5b0c7669', '770 - Law Fisher', 'Cir wic re fop zo anbaca ku itahewgap rujnu cowme sikbe mulgutif pomketje rekjoh. Sej gekciwuz cel fo sih demiwvu vamjubel ado zoh sousa jir sasa ce honi tugnidma nosabpen minav wib.', '22ffaece-8f70-5f0e-8390-ba479c5b0406');
